import React, { useState } from 'react';

const DataConsumerPanel: React.FC = () => {
  const [min, setMin] = useState<number | ''>('');
  const [max, setMax] = useState<number | ''>('');

  const handleSubmit = () => {
    if (min !== '' && max !== '') {
      // Replace this with actual API call
      console.log(`Requesting data in range: min=${min}, max=${max}`);
      // fetch('/api/data-request', { method: 'POST', body: JSON.stringify({ min, max }) })
    }
  };

  return (
    <div style={{ textAlign: 'center', marginTop: '100px' }}>
      <h2>Data Consumer</h2>
      <h4>data type: blood_pressure</h4>
      <div style={{ marginTop: '20px' }}>
        <div style={{ margin: '10px' }}>
          <label>min: </label>
          <input
            type="number"
            value={min}
            onChange={(e) => setMin(Number(e.target.value))}
          />
        </div>
        <div style={{ margin: '10px' }}>
          <label>max: </label>
          <input
            type="number"
            value={max}
            onChange={(e) => setMax(Number(e.target.value))}
          />
        </div>
        <button
          onClick={handleSubmit}
          style={{
            marginTop: '20px',
            padding: '8px 16px',
            borderRadius: '6px',
            fontSize: '14px',
            backgroundColor: '#1976d2',
            color: 'white',
            border: 'none',
            cursor: 'pointer'
          }}
        >
          Submit
        </button>
      </div>
    </div>
  );
};

export default DataConsumerPanel;
